import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Add from "./App";

ReactDOM.render(
  <>
    <ul>
      <li>Addition of Two Number is {Add(10,10)}</li>
      <li>Subtration of Two Number is</li>
      <li>Divison of Two Number is</li>
      <li>Multiply of Two Number is</li>
    </ul>
  </>,
  document.getElementById("root")
);
